import React, { Component } from 'react';
import icon1 from './../../img/icon1.PNG';
import icon2 from './../../img/icon2.PNG';
import icon3 from './../../img/icon3.PNG';
import SortList from './SortList5';
import {NavLink} from "react-router-dom";
class PeopleUser extends Component {
    render() {
        return (
            <div className="cat-title mac-flex">
                <div>
                    <NavLink to="/donghonam">
                    <img src={icon1} />
                    <a href>Dành cho nam</a>
                    </NavLink>
                </div>
                <div>
                <NavLink to="/donghonam">
                    <img src={icon2} />
                    <a href>Dành cho nử</a>
                    </NavLink>
                </div>
                <div>
                <NavLink to="/c">
                    <img src={icon3} />
                    <a href>Cặp đôi</a>
                    </NavLink>
                </div>
                <SortList/>
            </div>


        )
    }
}
export default PeopleUser;
